import React, {Component} from "react";
import './Calculator.css'

import Button from "../components/Button";

export default class Clculator extends Component {
    render() {
        return (
            <div className="calculator">
                <Button />
                <button />
                <button />
                <button />
            </div>
        )
    }
}
